import React from "react";

import "./Title.css";

const title = props => (
  <div
    className="title"
    style={{ background: "url(./images/patterns/pattern_01.jpg)" }}
  >
    <p className="title__name">{props.name}</p>
    <p className="title_university">{props.university}</p>
    <p className="title__field">{props.field}</p>
    <p className="title__extera">{props.extera}</p>
  </div>
);

export default title;
